import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';


const mySkills = [
    { id: 1, server: "Frontend", skills: ["Html5", "css3", "Javascript", "Es6", "Bootstrap", "React-Bootstrap", "React js"] },
    { id: 2, server: "Backend", skills: ["Node Js", "C-language", "Graphql"] },
    { id: 3, server: "DataBase", skills: ["MySql", "Sql"] },
    { id: 4, server: "Server-Tools", skills: ["WinScp", "FileZilla", "PostMan", "Beyond Compare 4"] },
];

const exprienceProjects = [
    { id: 1, project: "C3crm", link: "https://user.c3crm.in/" },
    { id: 1, project: "Rizee", link: "https://rizee.in/" },
    { id: 1, project: "Farmers", link: "" },
];

const myDetails = [
    { id: 1, name: "Naresh Tanuri" },
    { id: 2, name: "nareshtanuri1418@gmail.com" },
    { id: 3, name: "+91 9347081115" },
    { id: 4, name: "Vijayawada,Andhra pradesh" }
];

const socialMedia = [
    { id: 1, http: "" },
];

const onlineJobPortals = [
    { id: 1, name: "Linkdin", http: "" },
    { id: 2, name: "Nakuri", http: "" },
    { id: 3, name: "Github", http: "" },
    { id: 4, name: "YouTube", http: "" },
];

const educationDetails = [
    { id: 1, platformName: "Bsc Computer", collegeName: "Teja Dvr Degree College -Nandigama", yearoffPassOut: "2019-2022" },
    { id: 2, platformName: "Mpc", collegeName: "Teja Dvr Junior College -Nandigama", yearoffPassOut: "2017-2019" },
    { id: 3, platformName: "Ssc", collegeName: "", yearoffPassOut: "2016-2017" },
]
const ResumeTemplate = () => {
    const [onlineJobPortals] = useState([onlineJobPortals]);
    return (
        <>
            <div className="container">
                <div className="d-flex flex-wrap">
                    {onlineJobPortals.map((item) => (
                        <div
                            key={item.id}
                            className='mt-2'
                            style={{ width: '18rem', cursor: 'pointer' }}
                        >
                            <div className="text-center">
                                <h5 className="card-title">{item.name}</h5>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </>
    )
}
export default ResumeTemplate;
